function [s,dsdF,D]=computeStress(...
  EvaluateStress,EvaluateLinearization,Transform,Parameters,X,F,Sizes)
% Compute stress

% Get general parameters
E=Parameters.YoungsModulus;
nu=Parameters.PoissonsRatio;
nsd=Sizes.NumSpaceDim;
msd=nsd*(nsd+1)/2;
ng=size(F,1);

% Evaluate elastic costants
if isa(E,'function_handle')
  E=E(X(:,1),X(:,2),X(:,3));
end
if isa(nu,'function_handle')
  nu=nu(X(:,1),X(:,2),X(:,3));
end

% Compute Lam√© parameters
mu=E./(2*(1+nu));
lambda=(nu.*E)./((1+nu).*(1-2*nu));
if nsd==2 && strcmp(Parameters.Assumption,'PlaneStress')
  lambda=(2*lambda.*mu)./(lambda+2*mu);
end

if strcmp(Parameters.DiscretizationType,'CG')
  % Initialization
  s=zeros(ng,nsd^2);
  dsdF=zeros(ng,nsd^4);
  D=NaN;
  
  % Extract deformation gradient
  if nsd==2
    Fxx=F(:,1); Fxy=F(:,2);
    Fyx=F(:,3); Fyy=F(:,4);
  elseif nsd==3
    Fxx=F(:,1); Fxy=F(:,2); Fxz=F(:,3);
    Fyx=F(:,4); Fyy=F(:,5); Fyz=F(:,6);
    Fzx=F(:,7); Fzy=F(:,8); Fzz=F(:,9);
  end
elseif strcmp(Parameters.DiscretizationType,'HDG')
  % Initialization
  s=NaN;
  dsdF=NaN;
  D=zeros(msd,msd);
end

% Evaluate stress tensor
if strcmp(EvaluateStress,'yes')
  if strcmp(Parameters.DiscretizationType,'CG')
    if strcmp(Transform,'no')
      if strcmp(Parameters.Model,'LinearElasticity')
        if nsd==2
          s(:,1)=2.*mu.*(Fxx-1)+lambda.*(Fxx+Fyy-2);
          s(:,2)=mu.*(Fxy+Fyx);
          s(:,3)=s(:,2);
          s(:,4)=2.*mu.*(Fyy-1)+lambda.*(Fxx+Fyy-2);
        elseif nsd==3
          s(:,1)=2.*mu.*(Fxx-1)+lambda.*(Fxx+Fyy+Fzz-3);
          s(:,2)=mu.*(Fxy+Fyx);
          s(:,3)=mu.*(Fxz+Fzx);
          s(:,4)=s(:,2);
          s(:,5)=2.*mu.*(Fyy-1)+lambda.*(Fxx+Fyy+Fzz-3);
          s(:,6)=mu.*(Fyz+Fzy);
          s(:,7)=s(:,3);
          s(:,8)=s(:,6);
          s(:,9)=2.*mu.*(Fzz-1)+lambda.*(Fxx+Fyy+Fzz-3);
        end
      elseif strcmp(Parameters.Model,'StVenantKirchhoff')
        if nsd==2
          s(:,1)=mu.*(2.*Fxx.*(Fxx.^2./2+Fyx.^2./2-1./2)+2.*Fxy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2))+Fxx.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fyx.^2./2+Fyy.^2./2-1);
          s(:,2)=mu.*(2.*Fxy.*(Fxy.^2./2+Fyy.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2))+Fxy.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fyx.^2./2+Fyy.^2./2-1);
          s(:,3)=mu.*(2.*Fyx.*(Fxx.^2./2+Fyx.^2./2-1./2)+2.*Fyy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2))+Fyx.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fyx.^2./2+Fyy.^2./2-1);
          s(:,4)=mu.*(2.*Fyy.*(Fxy.^2./2+Fyy.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2))+Fyy.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fyx.^2./2+Fyy.^2./2-1);
        elseif nsd==3
          s(:,1)=mu.*(2.*Fxx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fxy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fxz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2))+Fxx.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,2)=mu.*(2.*Fxy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fxz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2))+Fxy.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,3)=mu.*(2.*Fxz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fxy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2))+Fxz.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,4)=mu.*(2.*Fyx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fyy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fyz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2))+Fyx.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,5)=mu.*(2.*Fyy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fyz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2))+Fyy.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,6)=mu.*(2.*Fyz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fyx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fyy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2))+Fyz.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,7)=mu.*(2.*Fzx.*(Fxx.^2./2+Fyx.^2./2+Fzx.^2./2-1./2)+2.*Fzy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fzz.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2))+Fzx.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,8)=mu.*(2.*Fzy.*(Fxy.^2./2+Fyy.^2./2+Fzy.^2./2-1./2)+2.*Fzx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2+(Fzx.*Fzy)./2)+2.*Fzz.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2))+Fzy.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
          s(:,9)=mu.*(2.*Fzz.*(Fxz.^2./2+Fyz.^2./2+Fzz.^2./2-1./2)+2.*Fzx.*((Fxx.*Fxz)./2+(Fyx.*Fyz)./2+(Fzx.*Fzz)./2)+2.*Fzy.*((Fxy.*Fxz)./2+(Fyy.*Fyz)./2+(Fzy.*Fzz)./2))+Fzz.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fxz.^2./2+Fyx.^2./2+Fyy.^2./2+Fyz.^2./2+Fzx.^2./2+Fzy.^2./2+Fzz.^2./2-3./2);
        end
      elseif strcmp(Parameters.Model,'NeoHook')
        if nsd==2
          s(:,1)=(mu.*(2.*Fxx-(2.*Fyy)./(Fxx.*Fyy-Fxy.*Fyx)))./2+(Fyy.*lambda.*log(Fxx.*Fyy-Fxy.*Fyx))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,2)=(mu.*(2.*Fxy+(2.*Fyx)./(Fxx.*Fyy-Fxy.*Fyx)))./2-(Fyx.*lambda.*log(Fxx.*Fyy-Fxy.*Fyx))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,3)=(mu.*(2.*Fyx+(2.*Fxy)./(Fxx.*Fyy-Fxy.*Fyx)))./2-(Fxy.*lambda.*log(Fxx.*Fyy-Fxy.*Fyx))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,4)=(mu.*(2.*Fyy-(2.*Fxx)./(Fxx.*Fyy-Fxy.*Fyx)))./2+(Fxx.*lambda.*log(Fxx.*Fyy-Fxy.*Fyx))./(Fxx.*Fyy-Fxy.*Fyx);
        elseif nsd==3
          s(:,1)=(mu.*(2.*Fxx-(2.*(Fyy.*Fzz-Fyz.*Fzy))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2+(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fyy.*Fzz-Fyz.*Fzy))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,2)=(mu.*(2.*Fxy+(2.*(Fyx.*Fzz-Fyz.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2-(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fyx.*Fzz-Fyz.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,3)=(mu.*(2.*Fxz-(2.*(Fyx.*Fzy-Fyy.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2+(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fyx.*Fzy-Fyy.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,4)=(mu.*(2.*Fyx+(2.*(Fxy.*Fzz-Fxz.*Fzy))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2-(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fxy.*Fzz-Fxz.*Fzy))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,5)=(mu.*(2.*Fyy-(2.*(Fxx.*Fzz-Fxz.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2+(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fxx.*Fzz-Fxz.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,6)=(mu.*(2.*Fyz+(2.*(Fxx.*Fzy-Fxy.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2-(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fxx.*Fzy-Fxy.*Fzx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,7)=(mu.*(2.*Fzx-(2.*(Fxy.*Fyz-Fxz.*Fyy))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2+(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fxy.*Fyz-Fxz.*Fyy))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,8)=(mu.*(2.*Fzy+(2.*(Fxx.*Fyz-Fxz.*Fyx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2-(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fxx.*Fyz-Fxz.*Fyx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,9)=(mu.*(2.*Fzz-(2.*(Fxx.*Fyy-Fxy.*Fyx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx)))./2+(lambda.*log(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx).*(Fxx.*Fyy-Fxy.*Fyx))./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
        end
      end
    elseif strcmp(Transform,'push-forward')
      if strcmp(Parameters.Model,'LinearElasticity')
        if nsd==2
          s(:,1)=(Fxx.*(2.*mu.*(Fxx-1)+lambda.*(Fxx+Fyy-2)))./(Fxx.*Fyy-Fxy.*Fyx)+(2.*Fxy.*mu.*(Fxy./2+Fyx./2))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,2)=(Fyx.*(2.*mu.*(Fxx-1)+lambda.*(Fxx+Fyy-2)))./(Fxx.*Fyy-Fxy.*Fyx)+(2.*Fyy.*mu.*(Fxy./2+Fyx./2))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,3)=(Fxy.*(2.*mu.*(Fyy-1)+lambda.*(Fxx+Fyy-2)))./(Fxx.*Fyy-Fxy.*Fyx)+(2.*Fxx.*mu.*(Fxy./2+Fyx./2))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,4)=(Fyy.*(2.*mu.*(Fyy-1)+lambda.*(Fxx+Fyy-2)))./(Fxx.*Fyy-Fxy.*Fyx)+(2.*Fyx.*mu.*(Fxy./2+Fyx./2))./(Fxx.*Fyy-Fxy.*Fyx);
        elseif nsd==3
          s(:,1)=(Fxx.^2.*lambda-2.*Fxx.*mu-3.*Fxx.*lambda+2.*Fxx.^2.*mu+Fxy.^2.*mu+Fxz.^2.*mu+Fxx.*Fyy.*lambda+Fxx.*Fzz.*lambda+Fxy.*Fyx.*mu+Fxz.*Fzx.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,2)=(Fxx.*Fyx.*lambda-2.*Fyx.*mu-3.*Fyx.*lambda+Fyx.*Fyy.*lambda+Fyx.*Fzz.*lambda+2.*Fxx.*Fyx.*mu+Fxy.*Fyy.*mu+Fxz.*Fyz.*mu+Fyx.*Fyy.*mu+Fyz.*Fzx.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,3)=(Fxx.*Fzx.*lambda-2.*Fzx.*mu-3.*Fzx.*lambda+Fyy.*Fzx.*lambda+Fzx.*Fzz.*lambda+2.*Fxx.*Fzx.*mu+Fxy.*Fzy.*mu+Fxz.*Fzz.*mu+Fyx.*Fzy.*mu+Fzx.*Fzz.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,4)=(Fxx.*Fxy.*lambda-2.*Fxy.*mu-3.*Fxy.*lambda+Fxy.*Fyy.*lambda+Fxy.*Fzz.*lambda+Fxx.*Fxy.*mu+Fxx.*Fyx.*mu+2.*Fxy.*Fyy.*mu+Fxz.*Fyz.*mu+Fxz.*Fzy.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,5)=(Fyy.^2.*lambda-2.*Fyy.*mu-3.*Fyy.*lambda+Fyx.^2.*mu+2.*Fyy.^2.*mu+Fyz.^2.*mu+Fxx.*Fyy.*lambda+Fyy.*Fzz.*lambda+Fxy.*Fyx.*mu+Fyz.*Fzy.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,6)=(Fxx.*Fzy.*lambda-2.*Fzy.*mu-3.*Fzy.*lambda+Fyy.*Fzy.*lambda+Fzy.*Fzz.*lambda+Fxy.*Fzx.*mu+Fyx.*Fzx.*mu+2.*Fyy.*Fzy.*mu+Fyz.*Fzz.*mu+Fzy.*Fzz.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,7)=(Fxx.*Fxz.*lambda-2.*Fxz.*mu-3.*Fxz.*lambda+Fxz.*Fyy.*lambda+Fxz.*Fzz.*lambda+Fxx.*Fxz.*mu+Fxy.*Fyz.*mu+Fxx.*Fzx.*mu+Fxy.*Fzy.*mu+2.*Fxz.*Fzz.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,8)=(Fxx.*Fyz.*lambda-2.*Fyz.*mu-3.*Fyz.*lambda+Fyy.*Fyz.*lambda+Fyz.*Fzz.*lambda+Fxz.*Fyx.*mu+Fyy.*Fyz.*mu+Fyx.*Fzx.*mu+Fyy.*Fzy.*mu+2.*Fyz.*Fzz.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
          s(:,9)=(Fzz.^2.*lambda-2.*Fzz.*mu-3.*Fzz.*lambda+Fzx.^2.*mu+Fzy.^2.*mu+2.*Fzz.^2.*mu+Fxx.*Fzz.*lambda+Fyy.*Fzz.*lambda+Fxz.*Fzx.*mu+Fyz.*Fzy.*mu)./(Fxx.*Fyy.*Fzz-Fxx.*Fyz.*Fzy-Fxy.*Fyx.*Fzz+Fxy.*Fyz.*Fzx+Fxz.*Fyx.*Fzy-Fxz.*Fyy.*Fzx);
        end
      elseif strcmp(Parameters.Model,'StVenantKirchhoff')
        if nsd==2
          s(:,1)=(Fxx.*(mu.*(2.*Fxx.*(Fxx.^2./2+Fyx.^2./2-1./2)+2.*Fxy.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2))+Fxx.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fyx.^2./2+Fyy.^2./2-1)))./(Fxx.*Fyy-Fxy.*Fyx)+(Fxy.*(mu.*(2.*Fxy.*(Fxy.^2./2+Fyy.^2./2-1./2)+2.*Fxx.*((Fxx.*Fxy)./2+(Fyx.*Fyy)./2))+Fxy.*lambda.*(Fxx.^2./2+Fxy.^2./2+Fyx.^2./2+Fyy.^2./2-1)))./(Fxx.*Fyy-Fxy.*Fyx);
          s(:,2)=((Fxx.*Fyx+Fxy.*Fyy).*(Fxx.^2.*lambda-2.*mu-2.*lambda+Fxy.^2.*lambda+Fyx.^2.*lambda+Fyy.^2.*lambda+2.*Fxx.^2.*mu+2.*Fxy.^2.*mu+2.*Fyx.^2.*mu+2.*Fyy.^2.*mu))./(2.*(Fxx.*Fyy-Fxy.*Fyx));
          s(:,3)=((Fxx.*Fyx+Fxy.*Fyy).*(Fxx.^2.*lambda-2.*mu-2.*lambda+Fxy.^2.*lambda+Fyx.^2.*lambda+Fyy.^2.*lambda+2.*Fxx.^2.*mu+2.*Fxy.^2.*mu+2.*Fyx.^2.*mu+2.*Fyy.^2.*mu))./(2.*(Fxx.*Fyy-Fxy.*Fyx));
